const useDatafetch = () =>{

    const url="https://disease.sh/v3/covid-19/all";
    const [datas,setDatas] = useState([]);

    const fetch = async () =>{
        const response = await axios.get(url);
        setDatas([response.data]);
        console.log(datas);
   };
   useEffect(() => fetch(),[]);
   return datas
}
